jQuery(function(e){"use strict";const t=t=>{const e=document.getElementById("js-cookie-box"),n=+e.dataset.expire;Cookies.set("cookie-box",t,{expires:n}),e.classList.add("cookie-box-hide")};if(!Cookies.get("cookie-box")){const n=document.getElementById("js-cookie-box");n.classList.remove("cookie-box-hide"),e("#js-cookie-button-accept").click(()=>{t(!0)}),e("#js-cookie-button-reject").click(()=>{t(!1)})}})